import React from 'react';
import AlertCertificates from '../Components/AlertCertificates';


function MaxCertificates (Certificates){
    if (Certificates > 5){
        <AlertCertificates/>
    }
}

function TelaTres () {
    let Certificates = 0;
    return (
        <div> 
            <Button onChange={MaxCertificates(Certificates)}>
                
            </Button>
        </div>
    );
}

export default TelaTres;
